        static int GetMax(int num1, int num2)
        {
            return num1 > num2 ? num1 : num2;
        }
        public static int GetProduct(int[] nums)
        {
            int prod = 1;
            foreach (int value in nums)
            {
                prod *= value;
            }
            return prod;
        }


    }
